pragma solidity >=0.4.23 <0.6.0;

import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';

contract Tru is Ownable {

    struct Candidate {
        bytes32 candidateName;
        uint candidateVotes;
    }

    struct VotingProcess {
        mapping(uint => Candidate) candidates;
        bytes32[] candidatesIdx;
        uint votesNumber;
    }

    mapping(string => VotingProcess) votingProcesses;

    uint totalVotes;

    function registerCandidates(string memory _votingProcessId, bytes32[] memory _candidates) public onlyOwner {
        VotingProcess memory vp = VotingProcess({candidatesIdx : new bytes32[](0), votesNumber : 0});
        vp.candidatesIdx = _candidates;
        votingProcesses[_votingProcessId] = vp;
        for (uint i = 0; i < vp.candidatesIdx.length; i++) {
            votingProcesses[_votingProcessId].candidates[i] = Candidate({candidateName : vp.candidatesIdx[i], candidateVotes : 0});
        }
    }

    function getCandidates(string memory _votingProcessId) public view onlyOwner returns (bytes32[] memory){
        return votingProcesses[_votingProcessId].candidatesIdx;
    }

    function vote(string memory _votingProcessId, uint _candidateId) public onlyOwner {
        votingProcesses[_votingProcessId].candidates[_candidateId].candidateVotes += 1;
        votingProcesses[_votingProcessId].votesNumber += 1;
        totalVotes += 1;
    }

    function getResults(string memory _votingProcessId) public view returns(bytes32[] memory, uint[] memory){
        VotingProcess storage vp = votingProcesses[_votingProcessId];
        uint[] memory res = new uint[](vp.candidatesIdx.length);
        for(uint i = 0; i < vp.candidatesIdx.length; i++){
            res[i] = vp.candidates[i].candidateVotes;
        }
        return (vp.candidatesIdx, res);
    }

    function getVotesNumber(string memory _votingProcessId) public view onlyOwner returns(uint){
        return votingProcesses[_votingProcessId].votesNumber;
    }

    function getTotalVotesNumber() public view onlyOwner returns(uint){
        return totalVotes;
    }

    function kill() public onlyOwner {
        selfdestruct(address(int160(owner())));
    }
}
